import logo from "./logo.svg";
import "./App.css";
import { YoutubeData } from "./data";
// JSX: Javascript XML
// ES6
// Babel

/**
 * element = <div id="root">Hello World</div>: JSX
 *
 */

function Feature() {
  <div className="feature">
    <img src="" alt="" className="IMG" />
  </div>;
}
//Parent
function App() {
  // const name = "Evondev";

  // return (
  //   <div className="App">
  //     <header className="App-header">
  //       <img src={logo} className="App-logo" alt="logo" />
  //       {/* <p>
  //         Edit <code>src/App.js</code> and save to reload.
  //       </p> */}
  //       <h1>Hello {name}</h1>
  //       <h2></h2>
  //       <a
  //         className="App-link"
  //         href="https://reactjs.org"
  //         target="_blank"
  //         rel="noopener noreferrer"
  //       >
  //         Learn React
  //       </a>
  //     </header>
  //   </div>
  // );

  return (
    //children
    <div className="youtube-list">
      <YoutubeItem
        img="https://i.ytimg.com/vi/vwYwVJE0NF8/maxresdefault.jpg"
        avatar="https://lh6.googleusercontent.com/proxy/VnXd2Fo34PZGnYB2QWdGjJHQZHZnYHvZX81oqPrGPpys-azjZSj9HVk2sZmt1BfSrVOfuSSwZbR816GbicQHtcFpGe-voWST5xXLvF_TeX5K_7VJLbM2c74MQw"
        author="Hua Quang Han"
        title="Chuyện tôi và ma quỷ thành người một nhà 2022"
      ></YoutubeItem>
      <YoutubeItem
        img="https://images.fptplay53.net/media/OTT/VOD/2024/03/07/hon-le-cua-em-fpt-play-1709803394498_Landscape.jpg"
        avatar="https://lh6.googleusercontent.com/proxy/VnXd2Fo34PZGnYB2QWdGjJHQZHZnYHvZX81oqPrGPpys-azjZSj9HVk2sZmt1BfSrVOfuSSwZbR816GbicQHtcFpGe-voWST5xXLvF_TeX5K_7VJLbM2c74MQw"
        author="Hua Quang Han"
        title="Hôn Lễ Của Em 2021"
      ></YoutubeItem>
      <YoutubeItem
        img="https://www.elleman.vn/app/uploads/2024/04/15/232444/hua-quang-han_elleman.jpg"
        avatar="https://lh6.googleusercontent.com/proxy/VnXd2Fo34PZGnYB2QWdGjJHQZHZnYHvZX81oqPrGPpys-azjZSj9HVk2sZmt1BfSrVOfuSSwZbR816GbicQHtcFpGe-voWST5xXLvF_TeX5K_7VJLbM2c74MQw"
        author="Hua Quang Han"
        title="Thanh Xuân 18×2: Lữ Trình Hướng Về Em 2024"
      ></YoutubeItem>
      <YoutubeItem
        img="https://img-zlr1.tv360.vn/image1/2022/12/29/18/7e10397f/7e10397f-ee36-4742-ae6a-fefb3864a559_640_360.jpg"
        avatar="https://lh6.googleusercontent.com/proxy/VnXd2Fo34PZGnYB2QWdGjJHQZHZnYHvZX81oqPrGPpys-azjZSj9HVk2sZmt1BfSrVOfuSSwZbR816GbicQHtcFpGe-voWST5xXLvF_TeX5K_7VJLbM2c74MQw"
        author="Hua Quang Han"
        title="Muốn Gặp Anh 2019"
      ></YoutubeItem>
      {/* <YoutubeItem img="https://images2.thanhnien.vn/528068263637045248/2024/4/8/2-17125722964631404683765.jpg"></YoutubeItem> */}
    </div>
    // <div className="youtube=list">
    //   {YoutubeData.map((item, index) => (
    //     <YoutubeItem key={item.id}></YoutubeItem>
    //   ))}
    // </div>
  );
}
// Props = > Properties
function YoutubeItem(props) {
  return (
    <div className="youtube-item">
      <div
        className="youtube-img"
        // style={{
        //   height: "250px",
        // }}
      >
        <img
          src={props.img}
          alt=""
          //   style={{
          //   display: "block",
          //   maxWidth: "100%",
          //   width: "100%",
          //   height: "100%",
          //   objectFit: "cover"
          // }}
        />
      </div>
      <div className="youtube-footer">
        <img src={props.avatar} alt="" className="youtube-avatar" />
        <div className="youtube-info">
          <h3 className="youtube-title">
            {props.title || "Khong co ten phim"}
          </h3>
          <h4 className="youtube-author">
            {props.author || "Khong co ten tac gia"}
          </h4>
        </div>
      </div>
    </div>
  );
}

export default App;
